import React from "react";
import img1 from '../img/mini1.jpg';
import img2 from '../img/mini2.jpg';
import img3 from '../img/mini3.jpg';
import img4 from '../img/mini4.jpg';
import img5 from '../img/mini5.jpg';
import img6 from '../img/mini6.jpg';
import '../components/css/Carousel.css'

const Carousel = () => {
  return (
    <div className="carousel_movies">
      <div className="owl-carousel owl-theme">
        <div className="item">
            <img src={img1} alt="img" />
            <img src={img2} alt="img" />
            <img src={img3} alt="img" />
            <img src={img4} alt="img" />
            <img src={img5} alt="img" />
            <img src={img6} alt="img" />
        </div>

      </div>
    </div>
  );
};

export default Carousel;
